    ["APPLE MUSIC", "/img/apple.png"],
    ["DEEZER", "/img/deezer-small.png"],
    ["BANDCAMP", "/img/bandcamp.png"]
  ];
  return (
    <div className="button-link-container">
      {linkButtonListProps.map(button => (
        <LinkButton
          streamingService={button[0]}
          streamingServiceLogo={button[1]}
        />
